syntax = "proto2";
package proto;

// Updated for Multi-Device Protocol
message DevicePairing {
    optional string phoneNumber = 1;
    optional bytes ephemeralPrivateKey = 2;
    optional bytes identityKey = 3;
    optional bytes registrationId = 4;
}

message ClientHello {
    optional bytes ephemeralKey = 1;
    optional bytes staticKeyEnc = 2;
    optional bytes identityKeyEnc = 3;
}

message ServerHello {
    optional bytes ephemeralKey = 1;
    optional bytes staticKeyEnc = 2;
    optional bytes identityKeyEnc = 3;
}

message HandshakeMessage {
    optional ClientHello clientHello = 1;
    optional ServerHello serverHello = 2;
}

message SenderKeyDistributionMessage {
    optional string groupId = 1;
    optional bytes axolotlSenderKeyDistributionMessage = 2;
}

message FingerprintData {
    optional string publicKey = 1;
    optional string identifier = 2;
}

message CombinedFingerprint {
    optional uint32 version = 1;
    optional FingerprintData localFingerprint = 2;
    optional FingerprintData remoteFingerprint = 3;
}

message MessageKey {
    optional string remoteJid = 1;
    optional bool fromMe = 2;
    optional string id = 3;
    optional string participant = 4;
    optional uint32 deviceFingerprint = 5;
}

message ImageMessage {
    optional string url = 1;
    optional string mimetype = 2;
    optional string caption = 3;
    optional bytes fileSha256 = 4;
    optional uint64 fileLength = 5;
    optional uint32 height = 6;
    optional uint32 width = 7;
    optional bytes mediaKey = 8;
    optional bytes fileEncSha256 = 9;
    repeated InteractiveAnnotation interactiveAnnotations = 10;
    optional string directPath = 11;
    optional bytes jpegThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional bytes firstScanSidecar = 18;
    optional uint32 firstScanLength = 19;
    optional uint32 scanLengths = 20;
    optional bytes secondScanLength = 21;
    optional string firstScanLengthSidecar = 22;
    optional uint32 mediaKeyTimestamp = 23;
    optional bytes placeholderKey = 24;
    optional string gifPlayback = 25;
    optional uint32 avcLength = 26;
    optional bytes initialFrame = 27;
}

message ContactMessage {
    optional string displayName = 1;
    optional string vcard = 16;
    optional ContextInfo contextInfo = 17;
    optional string phoneNumber = 18;
    optional string email = 19;
    optional string address = 20;
}

message LocationMessage {
    optional double degreesLatitude = 1;
    optional double degreesLongitude = 2;
    optional string name = 3;
    optional string address = 4;
    optional string url = 5;
    optional bytes jpegThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional string comment = 18;
}

message ExtendedTextMessage {
    optional string text = 1;
    optional string matchedText = 2;
    optional string canonicalUrl = 4;
    optional string description = 5;
    optional string title = 6;
    optional fixed32 textArgb = 7;
    optional fixed32 backgroundArgb = 8;
    enum FONTTYPE {
        SANS_SERIF = 0;
        SERIF = 1;
        NORICAN_REGULAR = 2;
        BRYNDAN_WRITE = 3;
        BEBASNEUE_REGULAR = 4;
        OSWALD_HEAVY = 5;
    }
    optional FONTTYPE font = 9;
    optional bytes jpegThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional uint32 clientUrl = 18;
    optional string previewType = 19;
    optional bytes mediaKey = 20;
    optional uint32 mediaKeyTimestamp = 21;
    optional bytes jpegThumbnailEnc = 22;
    optional string inviteLinkGroupType = 23;
    optional string inviteLinkParentGroupSubject = 24;
    optional bool inviteLinkParentGroupJpegThumbnail = 25;
    optional string inviteLinkGrpType = 26;
    optional bytes inviteLinkParentThumb = 27;
    optional uint32 inviteLinkParentEphSetting = 28;
}

message DocumentMessage {
    optional string url = 1;
    optional string mimetype = 2;
    optional string title = 3;
    optional bytes fileSha256 = 4;
    optional uint64 fileLength = 5;
    optional uint32 pageCount = 6;
    optional bytes mediaKey = 7;
    optional string fileName = 8;
    optional bytes fileEncSha256 = 9;
    optional string directPath = 10;
    optional bytes jpegThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional uint32 thumbnailDirectPath = 18;
    optional bytes thumbnailSha256 = 19;
    optional bytes thumbnailEncSha256 = 20;
    optional uint32 mediaKeyTimestamp = 21;
    optional string contactVcard = 22;
    optional uint32 thumbnailHeight = 23;
    optional uint32 thumbnailWidth = 24;
}

message AudioMessage {
    optional string url = 1;
    optional string mimetype = 2;
    optional bytes fileSha256 = 3;
    optional uint64 fileLength = 4;
    optional uint32 seconds = 5;
    optional bool ptt = 6;
    optional bytes mediaKey = 7;
    optional bytes fileEncSha256 = 8;
    optional string directPath = 9;
    optional ContextInfo contextInfo = 17;
    optional bytes streamingSidecar = 18;
    optional bool waveform = 19;
    optional uint32 backgroundArgb = 20;
    optional uint32 mediaKeyTimestamp = 21;
}

message VideoMessage {
    optional string url = 1;
    optional string mimetype = 2;
    optional bytes fileSha256 = 3;
    optional uint64 fileLength = 4;
    optional uint32 seconds = 5;
    optional bytes mediaKey = 6;
    optional string caption = 7;
    optional bool gifPlayback = 8;
    optional uint32 height = 9;
    optional uint32 width = 10;
    optional bytes fileEncSha256 = 11;
    repeated InteractiveAnnotation interactiveAnnotations = 12;
    optional string directPath = 13;
    optional bytes jpegThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional bytes streamingSidecar = 18;
    enum ATTRIBUTION {
        NONE = 0;
        GIPHY = 1;
        TENOR = 2;
    }
    optional ATTRIBUTION gifAttribution = 19;
    optional uint32 avgBitrate = 20;
    optional string audioQuality = 21;
    optional bytes videoQuality = 22;
    optional uint32 encoding = 23;
    optional bytes thumbnailEncSha256 = 24;
    optional uint32 gifAttributionV2 = 25;
    optional bytes originalHash = 26;
    optional uint32 previewLength = 27;
    optional bytes preview = 28;
}

message Call {
    optional bytes callKey = 1;
    optional string conversionSource = 2;
    optional bytes conversionData = 3;
    optional uint32 conversionDelay = 4;
}

message ProtocolMessage {
    optional MessageKey key = 1;
    enum TYPE {
        REVOKE = 0;
        EPHEMERAL_SETTING = 3;
        EPHEMERAL_SYNC_RESPONSE = 4;
        HISTORY_SYNC_NOTIFICATION = 5;
        APP_STATE_SYNC_KEY_SHARE = 6;
        APP_STATE_SYNC_KEY_REQUEST = 7;
        MSG_FOLD = 8;
        INTERACTIVE_MESSAGE = 9;
        ORDER_MESSAGE = 10;
        EPHEMERAL_SYNC_RESPONSE_V2 = 11;
        PAYMENT_INVITE_MESSAGE = 12;
        CHANGE_EPHEMERAL_SETTING = 13;
        VIEW_ONCE_MESSAGE = 14;
        VIEW_ONCE_MESSAGE_V2 = 18;
        ORDER_DETAILS = 15;
        LIVE_LOCATION = 16;
        REQUEST_PHONE_NUMBER = 17;
    }
    optional TYPE type = 2;
    optional uint32 ephemeralExpiration = 3;
    optional int64 ephemeralDuration = 4;
    optional Message revokeMessage = 5;
    optional AppStateSyncKeyShare appStateSyncKeyShare = 6;
    optional InitialSecurityNotificationSettingSync initialSecurityNotificationSettingSync = 7;
    optional Message ephemeralWrapper = 8;
    optional string label = 9;
    optional HistorySyncNotification historySyncNotification = 10;
    optional Call call = 11;
    optional Message senderKeyDistributionMessage = 12;
    optional uint64 epoch = 13;
}

message ContactsArrayMessage {
    optional string displayName = 1;
    repeated ContactMessage contacts = 2;
    optional ContextInfo contextInfo = 17;
}

message HSMCurrency {
    optional string currencyCode = 1;
    optional int64 amount1000 = 2;
}

message HSMDateTimeComponent {
    enum DAYOFWEEKTYPE {
        MONDAY = 1;
        TUESDAY = 2;
        WEDNESDAY = 3;
        THURSDAY = 4;
        FRIDAY = 5;
        SATURDAY = 6;
        SUNDAY = 7;
    }
    optional DAYOFWEEKTYPE dayOfWeek = 1;
    optional uint32 year = 2;
    optional uint32 month = 3;
    optional uint32 dayOfMonth = 4;
    optional uint32 hour = 5;
    optional uint32 minute = 6;
    enum CALENDARTYPE {
        GREGORIAN = 1;
        SOLAR_HIJRI = 2;
    }
    optional CALENDARTYPE calendar = 7;
}

message HSMDateTimeUnixEpoch {
    optional int64 timestamp = 1;
}

message HSMDateTime {
    oneof datetimeOneof {
        HSMDateTimeComponent component = 1;
        HSMDateTimeUnixEpoch unixEpoch = 2;
    }
}

message HSMLocalizableParameter {
    optional string default = 1;
    oneof paramOneof {
        HSMCurrency currency = 2;
        HSMDateTime dateTime = 3;
    }
}

message HighlyStructuredMessage {
    optional string namespace = 1;
    optional string elementName = 2;
    repeated string params = 3;
    optional string fallbackLg = 4;
    optional string fallbackLc = 5;
    repeated HSMLocalizableParameter localizableParams = 6;
    optional string deterministicLg = 7;
    optional string deterministicLc = 8;
    optional ContextInfo contextInfo = 9;
}

message SendPaymentMessage {
    optional Message noteMessage = 2;
    optional string requestMessageId = 3;
}

message RequestPaymentMessage {
    optional string currencyCodeIso4217 = 1;
    optional uint64 amount1000 = 2;
    optional string requestFrom = 3;
    optional Message noteMessage = 4;
    optional int64 expiryTimestamp = 5;
    optional Attachment attachment = 6;
}

message LiveLocationMessage {
    optional double degreesLatitude = 1;
    optional double degreesLongitude = 2;
    optional uint32 accuracyInMeters = 3;
    optional float speedInMps = 4;
    optional uint32 degreesClockwiseFromMagneticNorth = 5;
    optional string caption = 6;
    optional int64 sequenceNumber = 7;
    optional uint32 timeOffset = 8;
    optional bytes jpegThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional uint32 pin = 18;
    optional bytes participant = 19;
    optional int64 ephemeralStartTimestamp = 20;
    optional uint32 ephemeralDuration = 21;
}

message StickerMessage {
    optional string url = 1;
    optional bytes fileSha256 = 2;
    optional bytes fileEncSha256 = 3;
    optional bytes mediaKey = 4;
    optional string mimetype = 5;
    optional uint32 height = 6;
    optional uint32 width = 7;
    optional string directPath = 8;
    optional uint64 fileLength = 9;
    optional bytes pngThumbnail = 16;
    optional ContextInfo contextInfo = 17;
    optional uint32 isAnimated = 18;
    optional bytes pngThumbnailEnc = 19;
    optional uint32 mediaKeyTimestamp = 20;
}

message Message {
    optional string conversation = 1;
    optional SenderKeyDistributionMessage senderKeyDistributionMessage = 2;
    optional ImageMessage imageMessage = 3;
    optional ContactMessage contactMessage = 4;
    optional LocationMessage locationMessage = 5;
    optional ExtendedTextMessage extendedTextMessage = 6;
    optional DocumentMessage documentMessage = 7;
    optional AudioMessage audioMessage = 8;
    optional VideoMessage videoMessage = 9;
    optional Call call = 10;
    optional Chat chat = 11;
    optional ProtocolMessage protocolMessage = 12;
    optional ContactsArrayMessage contactsArrayMessage = 13;
    optional HighlyStructuredMessage highlyStructuredMessage = 14;
    optional SenderKeyDistributionMessage fastRatchetKeySenderKeyDistributionMessage = 15;
    optional SendPaymentMessage sendPaymentMessage = 16;
    optional RequestPaymentMessage requestPaymentMessage = 17;
    optional LiveLocationMessage liveLocationMessage = 18;
    optional StickerMessage stickerMessage = 20;
    optional GroupInviteMessage groupInviteMessage = 21;
    optional TemplateMessage templateMessage = 22;
    optional StickerSyncRmrMessage stickerSyncRmrMessage = 23;
    optional InteractiveMessage interactiveMessage = 24;
    optional OrderMessage orderMessage = 25;
    optional ListMessage listMessage = 26;
    optional FutureProofMessage futureProofMessage = 27;
    optional MessageContextInfo messageContextInfo = 28;
    optional ListResponseMessage listResponseMessage = 29;
    optional DownloadableMessage downloadableMessage = 30;
    optional ReactionMessage reactionMessage = 31;
    optional MultiDeviceSyncMessage multiDeviceSyncMessage = 32;
    optional BackgroundBackground backgroundBackground = 33;
    optional PushToTalkMessage pushToTalkMessage = 34;
    optional UnsendRequestMessage unsendRequestMessage = 35;
}

message ContextInfo {
    optional string stanzaId = 1;
    optional string participant = 2;
    repeated Message quotedMessage = 3;
    optional string remoteJid = 4;
    repeated string mentionedJid = 15;
    optional string conversionSource = 18;
    optional bytes conversionData = 19;
    optional uint32 conversionDelaySeconds = 20;
    optional bool isForwarded = 22;
    optional uint32 quotedMessageId = 23;
    optional FutureproofMessageList disappearingTimeoutMessage = 24;
    optional uint32 deviceListMetadataVersion = 25;
    optional bytes deviceListMetadata = 26;
    reserved 16, 17;
}

message InteractiveAnnotation {
    repeated Point polygonVertices = 1;
    oneof action {
        Location location = 2;
    }
}

message Point {
    optional double x = 3;
    optional double y = 4;
}

message Location {
    optional double degreesLatitude = 1;
    optional double degreesLongitude = 2;
    optional string name = 3;
}

